import "../css/Footer.css"; // Custom CSS file

function Footer() {
  return (
    <footer className="footer bg-custom">
      <div className="container py-5">
        <div className="row">
          {/* Quick Links Section */}
          <div className="col-md-12 text-start mb-4">
            <h5 className="footer-title">QUICK LINKS</h5>
            <ul className="list-inline footer-links">
              <li className="list-inline-item">
                <a href="#">ENROL NOW</a>
              </li>
              <li className="list-inline-item">
                <a href="#">FEES</a>
              </li>
              <li className="list-inline-item">
                <a href="#">PROSPECTUS</a>
              </li>
              <li className="list-inline-item">
                <a href="#">LEARNING</a>
              </li>
              <li className="list-inline-item">
                <a href="#">EMPLOYMENT</a>
              </li>
              <li className="list-inline-item">
                <a href="#">TERM DATES</a>
              </li>
              <li className="list-inline-item">
                <a href="#">POLICIES</a>
              </li>
              <li className="list-inline-item">
                <a href="#">CHILD SAFETY</a>
              </li>
              <li className="list-inline-item">
                <a href="#">CONTACT US</a>
              </li>
              <li className="list-inline-item">
                <a href="#">COMPLAINTS FORM</a>
              </li>
            </ul>
          </div>

          {/* Social Media Links Section */}
          <div className="col-md-12 text-start mb-4">
            <h5 className="footer-title">FOLLOW US</h5>
            <ul className="list-inline">
              <li className="list-inline-item">
                <a href="#">
                  <i className="bi bi-facebook"></i>
                </a>
              </li>
              <li className="list-inline-item">
                <a href="#">
                  <i className="bi bi-twitter"></i>
                </a>
              </li>
              <li className="list-inline-item">
                <a href="#">
                  <i className="bi bi-instagram"></i>
                </a>
              </li>
              <li className="list-inline-item">
                <a href="#">
                  <i className="bi bi-linkedin"></i>
                </a>
              </li>
            </ul>
          </div>
        </div>
        <div className="container">
          <div className="row">
            {/* First Paragraph */}
            <div className="col-md-4 text-start">
              <p className="footer-text">
                The care, safety and wellbeing of all children and vulnerable
                people is a core and fundamental responsibility for our
                community.
              </p>
            </div>

            {/* Second Paragraph */}
            <div className="col-md-4 text-start">
              <p className="footer-text">
                We acknowledge the Traditional Owners of the land on which our
                College resides and pay our respects to their Elders, past,
                present and future.
              </p>
            </div>

            {/* Third Paragraph */}
            <div className="col-md-4 text-start mt-4 mt-md-0">
              <p className="footer-credits">
                Â© Salesian College Chadstone 2024 | Terms & Privacy | Website by
                IGNITE
              </p>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
